import React, { useEffect, useState } from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./Home";
import Addcustomer from "./Addcustomer";
import Audit from "./Audit";
import Header from "./Header";
import Admin from "./Admin";
import Manager from "./Manager";
import PrivateRoute from "./PrivateRoute";
import Login from "./Login";
import Driver from "./Driver";
import Dataman from "./Dataman";
import NewUser from "./NewUser";
import DropCustomer from "./DropCustomer";
import Logout from "./Logout";
import UpdateCustomer from "./UpdateCustomer";
import AddJob from "./AddJob";
import Job from "./Job";
import DropJob from "./DropJob";
import UpdateJob from "./UpdateJob";


const App = () => {
  return (
    <BrowserRouter>
      <Header />
      <Routes>
        <Route element={<PrivateRoute />}>
          <Route path="/" element={<Home />}></Route>
          <Route path="/admin" element={<Admin />}></Route>
          <Route path="/manager" element={<Manager />}></Route>
          <Route path="/driver" element={<Driver />}></Route>
          <Route path="/dataman" element={<Dataman />}></Route>
          <Route path="/addcustomer" element={<Addcustomer />}></Route>
          <Route path="/dropcustomer/:id" element={<DropCustomer />}></Route>
          <Route path="/updatecustomer/:id" element={<UpdateCustomer />}></Route>
          <Route path="/dropjob/:id" element={<DropJob />}></Route>
          <Route path="/updatejob/:id" element={<UpdateJob />}></Route>
          <Route path="/audit" element={<Audit />}></Route>
          <Route path="/newjob" element={<AddJob />}></Route>
          <Route path="/job" element={<Job />}></Route>
          <Route path="/logout" element={<Logout />}></Route>
        </Route>
        <Route path="/login" element={<Login />}></Route>
        <Route path="/newuser" element={<NewUser />}></Route>
      </Routes>
    </BrowserRouter>
  )
}
export default App;
